import React, { Component } from 'react';
import './App.css';
import NavBar from './component/NavBar/NavBar';
import PropertyList from './component/Property/PropertyList/PropertyList';

const initialState = {
	isSignedIn: false,
	properties: [
		{
			id: 1,
			location: 'Canada',
			title: 'Hotel',
			type: 'Hotel',
			price: 100,
			rating: 3.4
		},

		{
			id: 2,
			location: 'Canada',
			title: 'House',
			type: 'House',
			price: 102,
			rating: 4.0
		},

		{
			id: 3,
			location: 'Canada',
			title: 'Apartment',
			type: 'Apartment',
			price: 101,
			rating: 4.0
		},

		{
			id: 4,
			location: 'Canada',
			title: 'Apartment',
			type: 'Apartment',
			price: 101,
			rating: 4.0
		}
	],

	links: [{ label: 'Become a host' }, { label: 'About' }],
	profileItem: [{ label: 'Profile' }, { label: 'Log out' }]
};

//TODO: Create Footer

class App extends Component {
	constructor() {
		super();
		this.state = initialState;
	}

	render() {
		const { properties, links } = this.state;
		return (
			<div>
				<NavBar links={links} />
				<div className='main'>
					<PropertyList
						properties={properties}
						type={'Hotel'}
					/>
					<PropertyList
						properties={properties}
						type={'House'}
					/>
					<PropertyList
						properties={properties}
						type={'Apartment'}
					/>
				</div>
			</div>
		);
	}
}

export default App;
